 const UnRetourPeutEtre = "{\"parsed\":{\"_path\":\"/blog/un-retour-peut-etre\",\"_dir\":\"blog\",\"_draft\":false,\"_partial\":false,\"_locale\":\"\",\"title\":\"Un retour peut-être ?\",\"description\":\"\",\"permalink\":\"un-retour-peut-etre\",\"image\":\"/pictures/resizeMCO00391.jpg\",\"author\":\"macojaune\",\"date\":\"2024-07-23T06:27:34.359Z\",\"updatedAt\":\"2024-07-23T06:27:34.359Z\",\"layout\":\"post\",\"draft\":false,\"body\":{\"type\":\"root\",\"children\":[{\"type\":\"element\",\"tag\":\"blockquote\",\"props\":{},\"children\":[{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"\\\"Document don't create\\\" − Gary Vee\"}]}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"J’ai envie de me remettre à créer du contenu, non, j’ai envie de recommencer à documenter mon quotidien.\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"J’ai justement remarqué que je créais et cherchais quoi créer ces derniers temps… Je me suis laissé avoir par les algorithmes et la création de contenu…\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Je ne veux pas être un créateur de contenu, bien au contraire je veux créer bien plus que du contenu.\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"D’ailleurs Youtube l’a bien compris et il me harcèle avec des vidéos du genre “Document your life” ou “Why you should start a youtube channel” et tout plein d’autres vidéos qui me rappellent comment chaque point de vue est unique et important.\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Même si tu fais la même chose que d’autres, si tu le fais à ta façon ce ne sera jamais identique ou redondant.\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"On est quand même arrivé à un stade ou les youtubeurs tech, par exemple, reçoivent les meme produits en même temps, les testent et publient leurs essais et avis à la même minute, pour la sortie du produit.\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"En essayant de terminer le montage de la dernière vidéo de la série sur mes claviers  je me suis rendu compte à quel point je n’aimais pas cette façon de faire.\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"J’ai enregistré toutes les vidéos à la suite, avec le même cadrage et je trouve ça très… mécanique, ça manque de vie. On voit même pas ma tête ni rien, d’ailleurs ça fait un moment que je ne me suis pas mis face cam… je ne sais même pas pourquoi. L’énergie n’y était pas.\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Elle n’était pas la du tout en vrai mais ça revient petit à petit, je planifie même des séances photos pour tout vous dire. Incroyable !\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Du coup pour revenir au sujet initial, là j’ai envie d’utiliser tiktok pour reprendre un genre de journaling vidéo. C’est le réseau où j’ai le moins d’audience et pourtant c’est celui sur lequel je passe le plus de temps à consommer du contenu tellement j’apprécie la qualité et la variété de ce qu’on m’y propose.\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Je ne sais pas encore comment tout ceci va se goupiller, j’ai à la fois envie de partir à l’arrache filmé sur le tel, sans montage ni rien et de mettre en scène chaque vidéo avec un rendu cinématique comme les contenus que j’admire.\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"On verra comment ça s’enclenche. Je ne force rien.\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Tout vient à point, tu connais le dicton…\"}]}],\"toc\":{\"title\":\"\",\"searchDepth\":2,\"depth\":2,\"links\":[]}},\"_type\":\"markdown\",\"_id\":\"content:blog:Un-retour-peut-etre.md\",\"_source\":\"content\",\"_file\":\"blog/Un-retour-peut-etre.md\",\"_stem\":\"blog/Un-retour-peut-etre\",\"_extension\":\"md\"},\"hash\":\"HySiSpTFdD\"}";

